import { stringify } from 'querystring';
import React from 'react';
import './App.css';

function App() {
  const feeds = fetch('http://127.0.0.1:5002/api/v1/feeds', {
    method: 'GET',
    headers: {'Content-Type': 'application/json'},
    //body: JSON.stringify(body)
  }).then(res => res.json())

  useEffe
  return (
    <div className="App">
      <div>{feeds.map((feed: any) => feed)}</div>
    </div>
  );
}

export default App;
